[{"location":"#SparseSparse","page":"Home","title":"SparseSparse","text":"SparseSparse is a Julia package for inverting sparse matrices with sparse inverses, or solving sparse linear problems with sparse right-hand-sides.","category":"section"},{"location":"#Installation","page":"Home","title":"Installation","text":"using Pkg; Pkg.add(\"SparseSparse\")","category":"section"},{"location":"#Overview","page":"Home","title":"Overview","text":"A matrix A is doubly sparse if both A and A^-1 are sparse. The class of doubly sparse matrices includes all matrices of the form P(prod B_k) Q where PQ are permutations and B_k are block diagonal.\n\nWith stock Julia, inverting a sparse matrix throws an error. SparseSparse provides functionality to invert sparse matrices and produce sparse inverses.","category":"section"},{"location":"#Basic-Usage","page":"Home","title":"Basic Usage","text":"using LinearAlgebra, SparseArrays, SparseSparse\nA = sparse([2.0  3.0  0.0  0.0\n             4.0  5.0  0.0  0.0\n             0.0  0.0  6.0  7.0\n             0.0  0.0  8.0  9.0])\ninv(A)","category":"section"},{"location":"#Module-reference","page":"Home","title":"Module reference","text":"","category":"section"},{"location":"#Types-reference","page":"Home","title":"Types reference","text":"","category":"section"},{"location":"#Functions-reference","page":"Home","title":"Functions reference","text":"","category":"section"},{"location":"#Index","page":"Home","title":"Index","text":"","category":"section"},{"location":"#SparseSparse.Factorization-Union{Tuple{SparseArrays.SparseMatrixCSC{Tv, Ti}}, Tuple{Ti}, Tuple{Tv}} where {Tv, Ti<:Integer}","page":"Home","title":"SparseSparse.Factorization","text":"function Factorization(A::SparseMatrixCSC)\n\nCompute a sparse factorization of the sparse matrix A. This returns a Factorization object F with fields F.L, F.U, F.p, F.q. The fields L and U are sparse lower and upper triangular matrices, and p and q are permutation vectors. Any of these fields can be replaced by the value missing.\n\n\n\n\n\n","category":"method"},{"location":"#Base.:\\-Union{Tuple{Ti}, Tuple{Tv}, Tuple{Factorization{Tv, Ti}, SparseArrays.SparseMatrixCSC{Tv, Ti}}} where {Tv, Ti<:Integer}","page":"Home","title":"Base.:\\","text":"function Base.:\\(A::Factorization, B::SparseMatrixCSC)\n\nSolve the problem A*X=B for the unknown X, where A is a Factorization object and B is sparse.\n\n\n\n\n\n","category":"method"},{"location":"#SparseSparse.solve-Union{Tuple{Ti}, Tuple{Tv}, Tuple{SparseArrays.SparseMatrixCSC{Tv, Ti}, SparseArrays.SparseMatrixCSC{Tv, Ti}}} where {Tv, Ti<:Integer}","page":"Home","title":"SparseSparse.solve","text":"function solve(L::SparseMatrixCSC{Tv,Ti},B::SparseMatrixCSC{Tv,Ti};solvemode=detect,numthreads=min(B.n,nthreads())) where {Tv,Ti<:Integer}\n\nSolve L*X=B for the unknown X, where L and B are sparse matrices. L should be either lower or upper triangular. If numthreads>1 then multithreading is used. solvemode should be either lower, upper or detect.\n\n\n\n\n\n","category":"method"}]
